import { useState } from "react";

let getTimeFromDate = (date) => date.slice(11, 19);

export const MyComponent = (props) => {
	const [date, setDate] = useState(new Date());

	setTimeout (() => {
		setDate(new Date());},
	1000);

	const time = getTimeFromDate(date)

	return (
		<div>{time}</div>
	)
};
